import React from 'react';
import ReactDualRangeSlider from 'react-dual-range-slider';
// import 'react-rangeslider/lib/index.css';
import './WidgetBar.css';

class PriceFilter extends React.Component {
	constructor(props){
		super(props);
		this.state = {
			title: 'price filter',
			min: 0,
			max: 1000
		}
		this.changePriceRange = this.changePriceRange.bind(this);
	}
	// changePriceRange(value){
	// 	this.setState({
	// 		min: 
	// 	})
	// }
	render(){
		let { volume } = this.state;
		return (
			<div className="widget-wrapper">
				<h3 className="widget-header">{this.state.title}</h3>
				<ReactDualRangeSlider limits={[0, 100]} />
			</div>
		)
	}
}

export default PriceFilter;
